import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";
import {
  fetchMarketSummary,
  fetchTopGainers,
  fetchTopLosers,
} from "../services/apiService";
import "./Dashboard.css";

const Dashboard = () => {
  const [marketSummary, setMarketSummary] = useState(null);
  const [topGainers, setTopGainers] = useState([]);
  const [topLosers, setTopLosers] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Овие функции би направиле API повици до вашиот backend
        const summaryData = await fetchMarketSummary();
        const gainersData = await fetchTopGainers();
        const losersData = await fetchTopLosers();

        setMarketSummary(summaryData);
        setTopGainers(gainersData);
        setTopLosers(losersData);
      } catch (error) {
        console.error("Error fetching dashboard data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) {
    return <div className="loading">Loading dashboard data...</div>;
  }

  return (
    <div className="dashboard-container">
      <h1>Market Dashboard</h1>

      {marketSummary && (
        <div className="market-summary-container">
          <h2>Market Summary</h2>
          <div className="summary-stats">
            <div className="stat-card">
              <h3>Market Trend</h3>
              <p
                className={`trend ${
                  marketSummary.trend === "BULLISH" ? "bullish" : "bearish"
                }`}
              >
                {marketSummary.trend}
              </p>
              <p>Confidence: {marketSummary.confidence.toFixed(2)}%</p>
            </div>
            <div className="stat-card">
              <h3>Trading Volume</h3>
              <p>{marketSummary.volume.toLocaleString()}</p>
            </div>
            <div className="stat-card">
              <h3>Active Symbols</h3>
              <p>{marketSummary.activeSymbols}</p>
            </div>
          </div>

          <div className="market-chart">
            <h3>Market Index (Last 7 Days)</h3>
            <ResponsiveContainer width="100%" height={300}>
              <LineChart data={marketSummary.chartData}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="date" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Line
                  type="monotone"
                  dataKey="indexValue"
                  stroke="#8884d8"
                  activeDot={{ r: 8 }}
                />
              </LineChart>
            </ResponsiveContainer>
          </div>
        </div>
      )}

      <div className="stocks-container">
        <div className="top-stocks">
          <h2>Top Gainers</h2>
          <table className="stocks-table">
            <thead>
              <tr>
                <th>Symbol</th>
                <th>Price</th>
                <th>Change</th>
                <th>% Change</th>
              </tr>
            </thead>
            <tbody>
              {topGainers.map((stock) => (
                <tr key={stock.symbol}>
                  <td>
                    <Link to={`/stock/${stock.symbol}`}>{stock.symbol}</Link>
                  </td>
                  <td>${stock.price.toFixed(2)}</td>
                  <td className="positive">+${stock.change.toFixed(2)}</td>
                  <td className="positive">
                    +{stock.percentChange.toFixed(2)}%
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        <div className="top-stocks">
          <h2>Top Losers</h2>
          <table className="stocks-table">
            <thead>
              <tr>
                <th>Symbol</th>
                <th>Price</th>
                <th>Change</th>
                <th>% Change</th>
              </tr>
            </thead>
            <tbody>
              {topLosers.map((stock) => (
                <tr key={stock.symbol}>
                  <td>
                    <Link to={`/stock/${stock.symbol}`}>{stock.symbol}</Link>
                  </td>
                  <td>${stock.price.toFixed(2)}</td>
                  <td className="negative">
                    -${Math.abs(stock.change).toFixed(2)}
                  </td>
                  <td className="negative">
                    -{Math.abs(stock.percentChange).toFixed(2)}%
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      <div className="action-buttons">
        <Link to="/trends" className="action-button">
          View Market Trends
        </Link>
      </div>
    </div>
  );
};

export default Dashboard;
